import React from 'react';
import containerStyle from "./viewHeader.module.css";
import ButtonAddTask from "./ButtonAddTask";


const ViewTaskHeader = () => {
  return (
    <div className={containerStyle.topTitle}>
      <h2>Task List</h2>
      <ButtonAddTask />
    </div>
  );
};

export default ViewTaskHeader;
